use crate::sudoku;

const BIT9: [usize; 9] = sudoku::list::BIT9;
const GROUPS: [u128; 27] = sudoku::list::GROUPS;
const SET_CELLS: [u128; 81] = sudoku::list::SET_CELLS;
const BIT81: [u128; 81] = sudoku::list::BIT81;
const ALL81: u128 = sudoku::list::ALL81;

fn get_bits_list(bits: usize) -> Vec<usize> {
    BIT9.iter()
        .enumerate()
        .filter(|bit| bits & bit.1 != 0)
        .map(|bit| bit.0)
        .collect::<Vec<usize>>()
}

fn get_bits_lists() -> [Vec<usize>; 512] {
    const INIT: Vec<usize> = vec![];
    let mut bits_list = [INIT; 512];
    let mut bits = 0;
    while bits < 512 {
        bits_list[bits] = get_bits_list(bits);
        bits += 1;
    }
    bits_list
}

lazy_static! {
    static ref BITS_LISTS: [Vec<usize>; 512] = get_bits_lists();
}

