pub fn make_set_cells() {
    for cell_index in 0..81 as usize {
        let row = cell_index / 9;
        let col = cell_index % 9;
        let sqr = 3 * (row / 3) + col / 3;
        let set_cell =
            ((GROUPS[row] | GROUPS[col + 9] | GROUPS[sqr + 18]) ^ ALL81) | BIT81[cell_index];
        println!("0b{:081b},", set_cell)
    }
}

pub fn make_possibles() {
    let mut possibles: Vec<u128> = vec![ALL81];
    for row_index in 0..9 as usize {
        let mut new_possibles: Vec<u128> = Vec::new();
        for possible in possibles {
            let columns = ((possible & GROUPS[row_index]) >> (row_index * 9)) as usize;
            for col_index in BITS_LISTS.get(columns).unwrap().iter() {
                new_possibles.push(possible & SET_CELLS[row_index * 9 + col_index])
            }
        }
        possibles = new_possibles
    }
    for possible in possibles {
        println!("0b{:081b},", possible)
    }
}

pub struct PI {
    index: usize,
    possibles: Vec<PI>,
}

pub fn narow_possible_indexes(bits: u128, indexes: Vec<usize>) -> Vec<PI> {
    let mut possible_indexes = Vec::new();
    for index in &indexes {
        let combined = bits | POSSIBLES[*index];
        possible_indexes.push(PI {
            index: *index,
            possibles: narow_possible_indexes(
                combined,
                indexes
                    .iter()
                    .filter(|&i| POSSIBLES[*i] & combined == 0)
                    .map(|&i| i)
                    .collect::<Vec<usize>>(),
            ),
        })
    }
    possible_indexes
}

pub fn make_possible_combinations() {
    let mut count = 0;
    for &possible in POSSIBLES.iter() {
        let mut possible_indexes = narow_possible_indexes(
            possible,
            POSSIBLES
                .iter()
                .enumerate()
                .filter(|(_, &p)| p & possible == 0)
                .map(|(i, _)| i)
                .collect::<Vec<usize>>(),
        );
        count += 1;
        println!("{}", count)
    }
}

